import React from "react";
import "../App.css";
import Introduction from "../components/introduction";
import Firstpage from "../components/firstpage";
import Contactus from "../components/contactus";
import { Link } from "react-scroll";

const Home = () => {
  return (
    <>
      <Link
        activeClass="active"
        to="introduction"
        spy={true}
        smooth={true}
        offset={50}
        duration={500}
      >
        Your name
      </Link>
      <Firstpage />

      <Introduction />

      <Contactus />
    </>
  );
};

export default Home;
